SweetsMap::SweetsMap()
{
	Init();

	DrawOwnScn();
}

SweetsMap::~SweetsMap()
{

}

void SweetsMap::Update(Vector2 offset)
{

	

	mOffset = { offset.x_,offset.y_ };

}

void SweetsMap::DrawOwnScn()
{
	
	for (int y = 0; y < MAP_Y; y++)
	{
		for (int x = 0; x < MAP_X; x++)
		{

			DrawGraph(16 * x - mOffset.x_, 16 * y - mOffset.y_, mChipImage[mMapNomal[y][x]], true);

			DrawGraph(16 * x - mOffset.x_, 16 * y - mOffset.y_, mChipImage[mMapRoad[y][x]], true);

			DrawGraph(16 * x - mOffset.x_, 16 * y - mOffset.y_, mChipImage[mMapObj[y][x]], true);

			DrawGraph(16 * x - mOffset.x_, 16 * y - mOffset.y_, mChipImage[mMapShadow[y][x]], true);

			/*DrawFormatString(16 * x - mOffset.x_, 16 * y - mOffset.y_, GetColor(0, 255, 0), "%d", mMapObj[y][x]);*/
			
			DrawFormatString(0,10, GetColor(0, 0, 255), "mapPos=(%d,%d)", mOffset.x_, mOffset.y_);
		}
	}
}

bool SweetsMap::Init(void)
{

	if (LoadDivGraph("./image/s1.png", 10000, 100, 100, 16, 16, &mChipImage[0]) == -1)
	{
		return false;
	}

	
	//SetMap(mapID);

	return true;
}

